-- Name: update_visit_sum(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_visit_sum() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Проверяем, было ли изменение в isPaid
  IF NEW."isPaid" <> OLD."isPaid" THEN
    -- Обновляем "sum" только если isPaid теперь равно true
    IF NEW."isPaid" = true THEN
      NEW."sum" = COALESCE((SELECT SUM((proc->>'sum')::integer) FROM unnest(NEW."extraProcedures") proc), 0);
    END IF;
  END IF;

  RETURN NEW;
END;
$$;


