    v.id,
    v."patientId",
    v."doctorId",
    v."authorId",
    v."isRemindRequired",
    v."extraProcedures",
    v."isPaid",
    v."paymentMethodId",
        CASE
            WHEN (count(p."paymentMethodId") > 0) THEN json_agg(json_build_object('paymentId', p.id, 'amount', p.amount, 'paymentMethodId', p."paymentMethodId"))
